  valueInput() {
    return (
      <label htmlFor="value-input">
        Valor:
        <input
          data-testid="value-input"
          type="number"
          id="value-input"
          name="value"
        />
      </label>
    );
  }

  descriptionInput() {
    return (
      <label htmlFor="description-input">
        Descrição:
        <input
          data-testid="description-input"
          type="text"
          id="description-input"
          name="description"
        />
      </label>
    );
  }

  currencyInput() {
    return (
      <label htmlFor="currency-input">
        Moeda:
        <select data-testid="currency-input" id="currency-input" name="currency">

        </select>
      </label>
    );
  }

  methodInput() {
    return (
      <label htmlFor="method-input">
        Valor:
        <input data-testid="method-input" id="method-input" name="method" />
      </label>
    );
  }

  render() {

    return (
      <form>
        <fieldset>
        </fieldset>
      </form>
    );
  }
}

